import React from 'react';
import NavBar from './components/NavBar.js';
import Portada from './components/Portada.js';
import Quiensoy from './components/Quiensoy.js';
import Skills from './components/Skills.js';
import Softwares from './components/Softwares.js';



function App() {
   // Supongamos que tienes un array de datos como este:
   const datos = [
    { imagenSrc: 'ps.svg', alt: 'Adobe Photoshop', texto: 'Adobe Photoshop' },
    // Agrega más objetos de datos según sea necesario
  ];

  return (

    <div className="App">

      <NavBar /> {}
      <Portada />{}
      <Quiensoy />
      <Skills /> {} 
      <Softwares datos={datos} />



    </div>
  );
}

export default App;
